	scanf(\"%d\",&math);\n		if(math<60)\n			printf(\"Fail\\n\");\n		else\n			printf(\"Pass\\n\");\n	}\n	\n	return 0;\n}\n'),(1013,'#include<stdio.h>\nint main(){\n	int repeat,ri,c,d,i;\n	scanf(\"%d\",&repeat);\n	for(ri=1;ri<=repeat;ri++){\n		scanf(\"%d\",&c);\n		for(i=1;i<=3;i++){\n			scanf(\"%d\",&d);\n			if(d<c){\n				c=d;\n			}\n		}\n		printf(\"min is %d\\n\",c);\n	}\n	return 0;\n}'),(1014,'#include<stdio.h>\nint main(){\n	int n,i;\n	double k;\n	scanf(\"%d\",&n);\n	while(n--){\n		scanf(\"%d\",&i);\n		switch(i){\n		case 1:k=3.00;break;\n		case 2:k=2.50;break;\n		case 3:k=4.10;break;\n		case 4:k=10.20;break;\n		default:k=0.00;break;\n		}\n		printf(\"price=%.2lf\\n\",k);\n	}\n	\n	return 0;\n}'),(1015,'#include<stdio.h>\nint main()\n{\n	int t;\n	char n;\n	scanf(\"%d\",&t);	\n	while(t--)\n	{\n	\n		n=getchar();\n		if(n>=\'a\'&&n<=\'z\'){\n			printf(\"%c\",n-32);}\n		else if(n>=\'A\'&&n<=\'Z\')\n			printf(\"%c\",n+32);\n		else printf(\"%c\",n);\n		\n	}\n	printf(\"\\n\");\n	return 0;\n}'),(1016,'#include<stdio.h>\nint main(){\n	int n,j,i;\n	double sum;\n	scanf(\"%d\",&n);\n	while(n--){\n		sum=0;\n		scanf(\"%d\",&j);\n		for(i=1;i<=j;i++){\n			sum+=1*1.0/i;	\n		}\n		printf(\"%.3lf\\n\",sum);\n\n	}\n\nreturn 0;\n}'),(1017,'#include<stdio.h>\n#include<math.h>\nint main(){\n	int repeat,ri,i;\n	double x,n;\n	scanf(\"%d\",&repeat);\n	for(ri=1;ri<=repeat;ri++){\n		scanf(\"%lf\",&x);\n		n=x;\n		for(i=(int)x-1;i>0;i--){\n			n=n*i;\n		}\n		printf(\"%.0lf\\n\",n);\n	}\n	return 0;\n}'),(1018,'#include<stdio.h>\n#include<math.h>\nint main(){\n	int n,i;\n	double j;\n	scanf(\"%d\",&n);\n	while(n--){\n		scanf(\"%lf%d\",&j,&i);\n		printf(\"%.2lf\\n\",pow(j,i));\n\n	}\n\nreturn 0;\n}'),(1019,'#include<stdio.h>\nint main(){\n	int n,i,flag,j;\n	double sum;\n	scanf(\"%d\",&n);\n	while(n--){\n		flag=1;\n		sum=0;\n		scanf(\"%d\",&j);\n		for(i = 1;i<=j;i++){\n			sum+=1*1.0/i*flag;\n			flag=-flag;\n		}\n		printf(\"%.3lf\\n\",sum);\n	}\n\nreturn 0;\n}'),(1020,'#include <stdio.h>\nint main()\n{\n	int ri,repeat,beg,end,c,f;\n	scanf(\"%d\",&repeat);\n	for(ri=1;ri<=repeat;ri++)\n	{\n		scanf(\"%d%d\",&beg,&end);\n		printf(\"Celsius Fahrenheit\\n\");\n		for(c=beg;c<=end;c++)\n		{\n			f=32+c*9/5;\n			printf(\"%d%10d\\n\",c,f);		\n		}\n	}\n	return 0;\n}'),(1021,'#include<stdio.h>\n#include<math.h>\nint main()\n{\n	int t,s,a;\n	scanf(\"%d\",&t);\n	while(t--){\n		s=0;\n		scanf(\"%d\",&a);\n		while(a>0){\n			if(a%2==1)\n			s+=a;\n			scanf(\"%d\",&a);\n		}\n		printf(\"%d\\n\",s);\n	}\n	return 0;\n}'),(1022,'#include <stdio.h>\nint main()\n{\n	int ri,repeat,n,i,j,a[80],t;\n	scanf(\"%d\",&repeat);\n	for(ri=1;ri<=repeat;ri++)\n	{\n		scanf(\"%d\",&n);\n		for(i=0;i<n;i++)\n			scanf(\"%d\",&a[i]);\n		for(i=1;i<n;i++)\n			for(j=0;j<n-1;j++)\n				if(a[j]>a[j+1])\n				{\n					t=a[j];a[j]=a[j+1];a[j+1]=t;\n				}\n		printf(\"%d\\n\",a[n-1]);\n\n	}\n	return 0;\n}'),(1023,'#include<stdio.h>\n#include<string.h>\nint main()\n{\n	int t,i,s,count;\n	char n[1000000];\n	scanf(\"%d\",&t);\n	getchar();\n	while(t--){\n		scanf(\"%s\",n);\n		getchar();\n		s=0;\n		count=strlen(n);\n		if(n[0]==\'-\'){\n			count--;\n			for(i=1;i<count+1;i++)\n				s+=n[i]-\'0\';\n		}\n		else\n			for(i=0;i<count;i++)\n			s+=n[i]-\'0\';\n\n		\n		\n		printf(\"number=%d,sum=%d\\n\",count,s);\n	}\n	return 0;\n}'),(1024,'#include<stdio.h>\nint main(){\n	int t,i,n;\n	double s;\n	int fun1(int n),fun2(int n);\n	scanf(\"%d\",&t);\n	while(t--){\n		s=0;\n		scanf(\"%d\",&n);\n	\n		for(i=1;i<=n;i++){\n			s+=fun1(i)*1.0/fun2(i);\n		}\n		printf(\"%.2f\\n\",s);\n	}\n	return 0;\n}\nint fun1(int n){\n	int a=1,c,b=1,i;\n	for(i=1;i<=n;i++)\n	{c=b;\n		b=a;\n		\n		a=a+c;\n		\n		\n	}\n	return a;\n}\nint fun2(int n){\n	int a=1,b=0,c,i;\n	for(i=1;i<=n;i++){\n		c=b;\n			b=a;\n		a=a+c;\n		\n		\n	}\n	return a;\n}'),(1025,'#include<stdio.h>\nint main(){\n	int t,i,m,n,s,a;\n	scanf(\"%d\",&t);\n	while(t--){\n		scanf(\"%d%d\",&n,&m);\n		s=0;\n		a=n;\n		for(i=1;i<=m;i++)\n		{\n			s+=a;\n			a=a*10+n;\n		}\n		printf(\"%d\\n\",s);\n	}\n	return 0;\n}'),(1026,'#include<stdio.h>\nint su(int a){\n	int i;\n	for(i=2;i<=a/2;i++)\n		if(a%i==0){\n			return 0;\n			break;\n		}\n	if(i>a/2)\n		return 1;\n}\nint main(){\n	int n,a[11],i,j;\n	scanf(\"%d\",&n);\n	for(i=0;i<n;i++){\n		scanf(\"%d\",&a[i]);\n	}\n	for(i=0;i<n;i++){\n		if(a[i]==1){printf(\"NO\\n\");continue;}\n		if(su(a[i])==1)printf(\"YES\\n\");\n		else printf(\"NO\\n\");\n	}\n	\nreturn 0;\n}\n'),(1027,'#include<stdio.h>\n#include<string.h>\nint main(){\n	int t,i,n,l;\n	double s;\n	scanf(\"%d\",&t);\n	while(t--){\n		s=0;\n		l=1;\n		scanf(\"%d\",&n);\n		for(i=1;i<=n;i++){\n			l=i*l;\n			s+=1.0/l;\n		}\n		printf(\"%.4f\\n\",s);\n	}\n	return 0;\n}'),(1028,'#include<stdio.h>\nint main()\n{\n	int r,j,i,k;\n	char s[10000];\n	scanf(\"%d\",&r);\n	for(i=1;i<=r;i++)\n	{\n		k=0;\n		scanf(\"%s\",s);\n		for(j=0;s[j]!=\'\\0\';j++)\n		{\n			if(s[j]==\'-\')\n				j++;\n			if(k>0)	\n				printf(\" \");\n			printf(\"%d\",s[j]-\'0\');\n			k++;\n		}\n		printf(\"\\n\");		\n	}\n	return 0;\n}'),(1029,'#include<stdio.h>\nint main()\n{\n	int i,j,r,count;\n	char s[10000];\n	scanf(\"%d\",&r);\n	for(i=1;i<=r;i++)\n	{\n		scanf(\"%s\",s);\n		count=0;\n		for(j=0;s[j]!=\'\\0\';j++)\n		{	\n			if(s[j]==\'2\')\n				count++;\n		}\n		printf(\"count=%d\\n\",count);\n	}\n\n	return 0;\n}'),(1030,'#include \"stdio.h\"\nint fib(int n)\n{\n if (n==1||n==2)return 1;\n else return fib(n-1)+fib(n-2);\n}\nvoid main()\n{\n int i,n,m,t,repeat,k;\n scanf(\"%d\",&repeat);\n while(repeat--){\n scanf(\"%d%d\",&m,&n);\n k=0;\n for(i=1;;i++)\n {\n  t=fib(i);\n  if(t>=m&&t<=n) \n  {\n	  if(k)printf(\" \");\n	  printf(\"%d\",t);\n	  k=1;\n\n  }\n  else if(t>n)break;\n }\n printf(\"\\n\");\n }\n}\n'),(1031,'#include \"stdio.h\"\nint factorsum(int n){ \n	int i,s=1;\n	for(i=2;i<n;i++)  \n		if(n%i==0) s+=i;\n		return s;}\nint main(){ \n	int i, m, n,k; \n	int repeat, ri; \n	int factorsum(int number);  \n	scanf(\"%d\", &repeat);  \n	for(ri = 1; ri <= repeat; ri++){\n        scanf(\"%d%d\", &m, &n);\n        k=0;       \n		for(i=m;i<=n;i++) \n			if(factorsum(i)==i)  {  \n				if(k) printf(\" \");   \n				k=1;              \n				printf(\"%d\",i);    \n			}                 printf(\"\\n\");  \n	}       return 0;\n}'),(1032,'#include<stdio.h>\n#include<string.h>\nint main(){\n	int t,i,s,l;\n	char a[20];\n	scanf(\"%d\",&t);\n	while(t--){\n		s=0;\n		scanf(\"%s\",a);\n		l=strlen(a);\n		for(i=0;i<l;i++)\n			s+=a[i]-48;\n		printf(\"number=%d,sum=%d.\\n\",l,s);\n	}\n	return 0;\n}'),(1033,'#include<stdio.h>\nint main(){\n	int t,i,m,n,s,a;\n	scanf(\"%d\",&t);\n	while(t--){\n		scanf(\"%d%d\",&n,&m);\n		s=0;\n		a=n;\n		for(i=1;i<=m;i++)\n		{\n			s+=a;\n			a=a*10+n;\n		}\n		printf(\"%d\\n\",s);\n	}\n	return 0;\n}'),(1034,'#include<stdio.h>\nint main(){\n	int t,i,m,n,s,a;\n	scanf(\"%d\",&t);\n	while(t--){\n		scanf(\"%d%d\",&n,&m);\n		s=0;\n		a=n;\n		for(i=1;i<=m;i++)\n		{\n			s+=a;\n			a=a*10+n;\n		}\n		printf(\"%d\\n\",s);\n	}\n	return 0;\n}'),(34,'#include <stdio.h>\r\nint main(){\r\n    puts(\"3\");\r\n    return 0;\r\n}'),(35,'#include <stdio.h>\r\nint main(){\r\n    puts(\"3\");\r\n    return 0;\r\n}'),(36,'#include <stdio.h>\r\nint main(){\r\n    puts(\"3\");\r\n    return 0;\r\n}'),(37,'#include <stdio.h>\r\nint main()\r\n{\r\n    int a,b;\r\n    while (~scanf(\"%d%d\",&a,&b))\r\n    printf(\"%d\\n\",a+b);\r\n    return 0;\r\n}'),(38,'#include <stdio.h>\r\nint main()\r\n{\r\n    puts(\"3\");\r\n    return 0;\r\n}');
